      "crypto": require.resolve("crypto-browserify"),
      "buffer": require.resolve("buffer/"),
      "constants": require.resolve("constants-browserify"),
      "os": require.resolve("os-browserify/browser"),
      "dns": false,
      "net": false,
      "fs": false,
      "child_process": false,
      "worker_threads": false,
      "module": false,
      "tls": false
    },
  },
  module: {
    rules: [
      {
        test: /\.js$/,
        use: 'babel-loader',
        exclude: /node_modules/,
      },
      {
        test: /\.node$/,
        use: 'node-loader'
      }
    ],
  },
};

